function Map(){this.keys=new Array();this.data=new Object();this.put=function(a,b){if(this.data[a]==null){this.keys.push(a)}this.data[a]=b};this.get=function(a){return this.data[a]};this.remove=function(a){this.keys.splice(a,1);this.data[a]=null};this.each=function(d){if(typeof d!="function"){return}var a=this.keys.length;for(var c=0;c<a;c++){var b=this.keys[c];d(b,this.data[b],c)}};this.entrys=function(){var a=this.keys.length;var c=new Array(a);for(var b=0;b<a;b++){c[b]={key:this.keys[b],value:this.data[b]}}return c};this.isEmpty=function(){return this.keys.length==0};this.size=function(){return this.keys.length}};